import Expenses from "./components/Expenses";

function App() {
  const expenses = [
    { id: "el1", date: new Date(2022, 1, 23), name: "New Desk", amount: 250 },
    {
      id: "el2",
      date: new Date(2022, 2, 2),
      name: "Car Insurance",
      amount: 130.59,
    },
    {
      id: "el3",
      date: new Date(2022, 2, 13),
      name: "Cell Phone",
      amount: 56.65,
    },
    { id: "el4", date: new Date(2021, 12, 6), name: "Internet", amount: 60 },
  ];

  return (
    <div>
      <Expenses items={expenses} />
    </div>
  );
}

export default App;
